window.addEventListener("load",()=>{document.getElementsByTagName("html")[0].style.visibility="visible";let e=document.querySelectorAll("body .body_class"),l=document.querySelectorAll("body a img");for(let t=0;t<e.length;t++)e[t].style.display="block",e[t].style.animation="fadeIn 2.5s";for(let s=0,a=1;s<l.length;s++,a+=.25)l[s].style.animation="gen "+a+"s ease"});